import React, { Component } from 'react';

class Viewer extends Component {
    render() {
        return (
            <div style={{ width: '100%', height: '100%' }}>
                <embed style={{ width: '100%', height: '100%' }} src={'./3D.html'}/>
            </div>
        );
    }
}

export default Viewer;
